import React, { useState, useRef } from 'react';
import styled from 'styled-components';
import writebackground from '../assets/writebackground.png';
import { useNavigate, useLocation } from 'react-router-dom';



const Container = styled.div`
  width: 440px;
  height: 956px;
  display: flex;
  align-items: center;
  justify-content: center;
  background-image: url(${writebackground});
  background-size: cover;
  background-position: center;
`;

const CardContainer = styled.div`
  width: 440px;
  height: 956px;
  display: flex;
  align-items: center;
  justify-content: center;
  backdrop-filter: blur(2px);
`;

const CenterInput = styled.input`
  width: 320px;
  height: 56px;
  border-radius: 18px;
  border: none;
  background: transparent;
  font-size: 20px;
  padding: 0 20px;
  box-shadow: 0 2px 8px 0 rgba(0,0,0,0.04);
  text-align: center;
  outline: none;
  color: #222;
  &::placeholder {
    color: #aaa;
    font-weight: 400;
  }
`;

const WeatherWriteKey = () => {
  return (
    <Container>
      <CardContainer>
        <CenterInput placeholder="이곳은 어떤 장소인가요?" />
      </CardContainer>
    </Container>
  );
};

export default WeatherWriteKey;
